Modify a field of all documents by appending time in the 'hh: mm A' format<p>These are the documents I have inside a collection:</p>

<pre><code>[
  {
    "unix_date": 1582133934,
    "text": "mongo"
  },  
  {
    "unix_date": 1580068560,
    "text": "some"
  },
]
</code></pre>

<p>I want to change the <code>text</code> field of all documents so that they look this way:</p>

<pre><code>[
  {
    "unix_date": 1582133934,
    "text": "mongo 12:00 PM"
  },  
  {
    "unix_date": 1580068560,
    "text": "some 3:00 PM"
  },
]
</code></pre>

<p>Note that I used random times.</p>

<p>This is what I tried:</p>

<pre><code>db.collection.update({}, [{
  $set: {
    text: {
      $concat: ["$text", new Date("$unix_date" * 1000).toString()]
    }
  }
}], {
  multi: true
})
</code></pre>

<p>this is appending <code>invalid date</code> to the <code>text</code> field and even if it does append the correct string how can I format it to <code>hh: mm AM/PM</code>. Is this possible without using any external libraries? I want to do this directly inside the shell.</p>

