Mongoose not returning records in .find() when used with multiple connections<p>I am facing a weird issue when working with multiple connections in mongoose 4.x.</p>

<p>After following the instructions in their <a href="https://mongoosejs.com/docs/4.x/docs/connections.html" rel="nofollow noreferrer">documentation</a>, I created two connections for the two databases I need to use (<code>db1.js</code> and <code>db2.js</code>).</p>

<p>When I try to fetch records in both databases, for some reason one of the <code>find()</code> calls returns no data. For instance, considering the database below, <code>User1.find({})</code> should return 3 records (which is correct), and <code>User2.find({})</code> should return 2 (which doesn't happen).</p>

<p>Any idea on what would be the issue is much appreciated!</p>

<p><strong>Database dump to reproduce</strong></p>

<pre><code>use db1;

db.createUser({
    user: "admin",
    pwd: "admin",
    roles: [
        { role: "dbAdmin", db: "db1" },
        { role: "dbAdmin", db: "db2" },
    ]
});

db.user1.insert({ "name": "Isa1" });
db.user1.insert({ "name": "Joe1" });
db.user1.insert({ "name": "Doe1" });

use db2;

db.createUser({
    user: "admin",
    pwd: "admin",
    roles: [
        { role: "dbAdmin", db: "db1" },
        { role: "dbAdmin", db: "db2" },
    ]
});

db.user2.insert({ "name": "Isa2" });
db.user2.insert({ "name": "Doe2" });
</code></pre>

<p><strong>db1.js</strong></p>

<pre><code>const Mongoose = require("mongoose");
const RSVP = require("rsvp");

Mongoose.Promise = RSVP.Promise;
let options = {
    useMongoClient: true,
    autoReconnect: true,
    keepAlive: 3000000,
    connectTimeoutMS: 300000
};

let schema = new Mongoose.Schema({ name: String });

const conn1 = Mongoose.connect('mongodb://admin:admin@localhost/db1', options);
module.exports = conn1.model('User1', schema);

</code></pre>

<p><strong>db2.js</strong></p>

<pre><code>const Mongoose = require("mongoose");
const RSVP = require("rsvp");

Mongoose.Promise = RSVP.Promise;
let options = {
    useMongoClient: true,
    autoReconnect: true,
    keepAlive: 3000000,
